import React from "react";



function NavBar(){

    return  <div>
                <nav class="navbar">
                
                    <span class="navbar-brand">Poolit <a href="/"><img src="photos/swimming-logo.ico" alt="Poolit Logo"></img></a></span>
                    <span class="navbar-right ml-auto"><a href="/login">Login</a></span>
                    <span class="navbar-right "><a href="/register">Register</a></span>

                </nav>
            </div>
}




export default NavBar;
